import React from 'react';

const NewsListItems = (props) => {
  return (
    <>
      {props.news.map((item)=>(
        <div>
          <h3>{ item.title }</h3>
          <div>
            { item.feed }
          </div>
        </div>
      )) }

    </>
    )
}

export default NewsListItems;
